import React from "react";
import { useParams } from "react-router-dom";

function Output() {
  // Get the result from route parameters
  const { result } = useParams();

  return (
    <div>
      <h2>Output Card</h2>
      {result && (
        <div>
          <h3>Your Fitness Plan:</h3>
          <p>Reuslt: {result}</p>
        </div>
      )}
    </div>
  );
}

export default Output;
